st.write('**Project Overview Description**: I plan to analyze voter turnout rates over several past federal election cycles to see if this variable can predict reduced poverty rates. My hypothesis will be that when voter turnout increases, this increase will most likely come from demographic groups that do not vote at as high rates as others. Consequentially, this increased voter turnout will result in policies that directly benefit these traditionally marginalized groups, reducing poverty rates in the process. Policies that directly benefit marginalized groups will be operationally defined as changes in welfare spending, with the hypothesis being that increased welfare spending imporves the livelihoods of marginalized groups. The efficacy of increased welfare spending and federal voter turnout rates shall be measured both by seeing the effect that each has on poverty, as well as on GDP per Capita, which is another common measure of individual economic prosperity. I will graph voter turnout rates in federal elections, presidential or midterm, against the percent change in the poverty rate two years later, as well as against statistics which measure individual facets of poverty.')

