st.write('**Project Findings**')

st.write('At the beginning of this project, I hypothesized that increased voter turnout, particularly at the federal level, brings more attention to the needs of marginalized groups. Politicians would thus be inclined to pursue policies that favor their newfound constituencies, boosting economic growth and reducing poverty. I operationally defined helpful policies as an increase in welfare spending, since my hypothesis was that more welfare spending provides critical aid to marginalized groups.')

st.write('Though my hypothesis that increased federal voter turnout is associated with reduced poverty rates was not completely false  my model predicts that a 1 percent increase in the United States Federal voter turnout rate results in a -0.0002 decrease in poverty over the next two years  it was not proven correct either. This is because the p-value of the f and t statistics both clearly exceeded my significance level of 0.05, proving that both my model and its individual values were not statistically significant.')

st.write('My hypothesis that welfare spending assists marginalized groups, however, was more blatantly false. This is because when I conducted regression analysis to see the effect of welfare spending on poverty rates, I found that increased welfare spending is associated with increases in poverty. Furthermore, the relationship was statistically significant, meaning these results were unlikely to occur merely by chance. Although its results were not statistically significant, the regression I conducted to analyze the effects of welfare spending on real GDP per capita yielded similar results. Increased welfare spending was associated with a reduction in real GDP per capita, though this relationship is not as strong as that between welfare spending and poverty.')

st.write('Originally, I predicted that both federal voter turnout and welfare spending are positively correlated with reduced poverty. While welfare spending turned out to be significantly correlated in the opposite direction, federal voter turnout was positively associated with reduced poverty, as I had previously hypothesized. Partly, this is due to the failure of my hypothesis that increased federal voter turnout boosts policies such as welfare spending. When I conducted regression analysis to view the effects of federal voter turnout on welfare spending, I found a negative, but not statistically significant, relationship between federal voter turnout and welfare spending. If federal voter turnout is negatively associated with welfare spending, and welfare spending is positively correlated with poverty, then it follows that when federal voter turnout rises, poverty most likely falls.')

st.write('Upon completing this project, I can conclude that voter turnout at all levels of government, not just federal, can lift people out of poverty and help create an economy that works for all. Though this project did not find a statistically significant relationship between federal voter turnout and reductions in poverty, it has yielded several key insights and potential steps for future research. First, increased voter turnout does not substantially impact immediate policy change. As shown by the regression I conducted, federal voter turnout has a negligible relationship with welfare spending. Possible reasons for this disconnect between voter turnout and policy change include that increased voter turnout, especially during midterm elections, can lead to a divided government, creating partisan gridlock that stymies action on policy.')

st.write('I can also conclude that welfare spending does not contribute to immediate gains in economic growth, at least according to the metrics of the poverty rate and real GDP per capita. This could be because welfare spending increases during times when poverty is increasing, making it seem like welfare spending is positively associated with poverty. Welfare spending could also have the effect of prolonging poverty, by disincentivizing its recipients to seek out regular employment.')

st.write('The largest conclusion that I took from this project is that changes in poverty and individual economic prosperity are far more connected to broad macroeconomic trends than they are to specific government policies. The clearest predictor of reduced poverty was increased GDP per capita, with no other variable coming close in terms of its predictive power for reduced poverty. This conclusion is in line with many guiding principles of macroeconomics, which teach that counter-cyclical government policy is not immediately effective, can sometimes have unintended effects, and that the past trends leading up to the present are of far more importance.')

st.write('Potential shortfalls of this research include that I plotted changes in welfare spending against changes in poverty to measure the efficacy of welfare spending in reducing poverty. When poverty rises dramatically, governments often pursue large increases in welfare spending to restore economic growth. By measuring poverty rates during, rather than after, increases in welfare spending, this project makes it seem like increased welfare spending leads to higher poverty rates, when this may not be the case at all.')

st.write('For future research in this area, there must be a better operational definition of what helpful policy is. Researchers should first attempt to find a positive relationship between a specific kind of policy and a reduction in adverse societal outcomes, such as poverty rates, and then research the effects of increased civic participation on the positive policy they have previously outlined. For United States federal elections, there is usually data going only as far back as 1960, making it difficult to find significant relationships. Therefore, a future researcher would likely find more success by implementing this research across each individual U.S state, analyzing the effect of statewide turnout on statewide poverty rates, since more samples improve the chance that a strong correlation will be found. Researchers should also be careful to measure changes in the dependent variable after changes in the independent variable are complete. For instance, changes in poverty should be measured once changes in welfare spending are complete.')
